import React from "react";
import Modal from "react-modal";
const ThresholdModalContent = (props) => {
  return (
    <div>
      <div className="addAndDeleteButtonsWrapper">
        <button className="addButton">Add</button>
        <button className="deleteButton">Delete</button>
      </div>
    </div>
  );
};

const Threshold = (props) => {
  return (
    <div className="modalContentWrapper">
      <div className="headerWrapper">
        <div className="header">{props.header}</div>
        <div className="helpAndCloseIcon">
          <div className="help">?</div>
          <div className="close">X</div>
        </div>
      </div>
      <div className="body">
        <ThresholdModalContent></ThresholdModalContent>
      </div>
      <div className="footer">
        <button id={props.buttonOneValue + "Button"} onClick={props.onSave}>
          {props.buttonOneValue}
        </button>
        <button id={props.buttonTwoValue + "Button"} onClick={props.onReset}>
          {props.buttonOneValue}
        </button>
        <button
          id={props.buttonThreeValue + "Button"}
          onClick={props.closeModal}
        >
          {props.buttonOneValue}
        </button>
      </div>
    </div>
  );
};

const customStyles = {
  content: {
    top: "50%",
    left: "50%",
    right: "auto",
    bottom: "auto",
    marginRight: "-50%",
    transform: "translate(-50%, -50%)",
  },
};
const ThresholdModal = (props) => {
  return (
    <Modal isOpen={props.isModalOpen} style={customStyles}>
      {/*       <ModalContent data={props} closeModal={props.closeModal} /> */}
      <Threshold></Threshold>
    </Modal>
  );
};

export { ThresholdModal as ThresholdModal };
